import { mobileAdministrationTwSelectCompany, twLogoutIfLoggedIn, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminTW } from "../../../../pageobjects/mobile-administration/GP";
import { loginWebV1Page } from "../../../../pageobjects/web/web-v1";
import { Header, LoginPage } from "../../../../pageobjects/web/web-v2";


describe("MOBILE ADMIN - USER ACTIVITIES", () => {
    describe("OPEN PAYOUTS TESTS", () => {
        it("Open open payouts page, verify page is loaded", () => {
            mobileTwAdministration();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.openPayoutsBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdminTW.userActivities.main.openPayoutsBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
            verifyIsVisible(MobileAdminTW.userActivities.openPayouts.tableResults.$("td*=Vanja"));
        });


    });
    describe("ACTIVE TERMINALS TESTS", () => {

        it("Open active terminals page, verify page is loaded", () => {
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.activeTerminalsBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdminTW.userActivities.main.activeTerminalsBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.searchBtn.click();
            verifyIsVisible(MobileAdminTW.userActivities.openPayouts.tableResults.$("td*=Vanja"));
        });
    });

    describe("USER ACCOUNT BALANCES TESTS", () => {

        it("Open user account balances, verify page is loaded", () => {
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.userAccountBalancesBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdminTW.userActivities.main.userAccountBalancesBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
            verifyIsVisible(MobileAdminTW.userActivities.openPayouts.tableResults.$("td*=VikiQAa"));
        });
    });

    describe("USER TRANSACTIONS TESTS", () => {

        it("Login to web, submit a slip", () => {
            webML();
            loginWebV1Page.usernameInput.clearValue();
            loginWebV1Page.passwordInput.clearValue();
            loginWebV1Page.usernameInput.addValue("vik69");
            loginWebV1Page.passwordInput.addValue("pass.1234");
            loginWebV1Page.signInBtn.click();

            const myBetsBtn = $(".header--primary__navigation__thumb--bets");
            expect(myBetsBtn).to.exist;
            myBetsBtn.click();
            browser.url("http://qa.webml.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");
            $("button=One-click bet").click();
            $("button[title='122']").click();
            browser.pause(2000);
            loginWebV1Page.logoutBtn.click();
            verifyIsVisible($("a*=Forgot your username?"));
        });

        it("Open user transactions page, verify page is loaded", () => {

            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.userTransactionsBtn);
        });


        it("Filter results, verify results are loaded", () => {
            browser.refresh();
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.waitForClickable();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            MobileAdminTW.userActivities.main.userTransactionsBtn.click();
            MobileAdminTW.userActivities.userTransactions.usernameInput.addValue('vik69');
            //MobileAdminTW.common.filter.displayBtn.waitForClickable();
            $("button[title='Display'] > .btn__label").click();
            $("button[title='Display'] > .btn__label").click();
            verifyIsVisible($("tbody > tr:nth-of-type(1)").$("td=Vanja/vik69"));
        });
    });

    describe("DAILY USER TRANSACTION TESTS", () => {

        it("Open active terminals page, verify page is loaded", () => {
            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.dailyUserTransactionsBtn);
        });


        it("Filter results, verify results are loaded", () => {
            MobileAdminTW.userActivities.main.dailyUserTransactionsBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
            verifyIsVisible($("table > tbody").$("td=Betting slip payment"));
        });
    });
    describe("CASH REGISTER TRANSACTION TESTS", () => {

        it("Login as cashier and deposit to account", () => {
            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("vcashiertwde", "mono.123");

            MobileAdminTW.menuItems.cashRegisterItem.click();
            MobileAdminTW.shop.main.depositWithdrawalBtn.click();
            MobileAdminTW.shop.depositWithdrawal.customerCardIDInput.addValue('duolimbo');
            MobileAdminTW.shop.depositWithdrawal.passwordInput.addValue('imbo');
            MobileAdminTW.shop.depositWithdrawal.loginButton.click();
            const value20 = $("div=20");
            const depositSuccessfullMessage = $("div=Deposit successful");
            const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

            value20.waitForClickable();
            value20.click();
            MobileAdminTW.shop.depositWithdrawal.depositBtn.click();
            verifyIsVisible(depositSuccessfullMessage);

            MobileAdminTW.shop.depositWithdrawal.payoutBtn.waitForClickable();
            MobileAdminTW.shop.depositWithdrawal.payoutBtn.click();
            verifyIsVisible(withdrawalSuccessfullMessage);

        });

        it("Open Cash Register Transactions page, verify page is loaded", () => {
            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            browser.pause(1000);
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.cashRegisterTransactionsBtn);
        });

        it("Filter results, verify results are loaded", () => {

            MobileAdminTW.userActivities.main.cashRegisterTransactionsBtn.click();
            const central = $("span=HR Central");
            const agency = $("span=MonoQA");
            const shopCheckbox = $("span=vShop");

            central.click();
            agency.click();
            shopCheckbox.scrollIntoView();
            shopCheckbox.click();
            const shopCashregistername = $("td*=vShop");
            const transactionType = $("td*=Cash payment");
            const cashRegsiter = $("span=vCashR");
            browser.pause(1000);
            cashRegsiter.scrollIntoView();
            cashRegsiter.click();
            MobileAdminTW.common.filter.displayBtn.click();
            verifyIsVisible(shopCashregistername);
            verifyIsVisible(transactionType);
        });
    });
    describe("DAILY CASH REGISTER TRANSACTIONS TESTS", () => {

        it("Open Daily Cash Register Transactions page, verify page is loaded", () => {
            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            browser.pause(1000);
            MobileAdminTW.menuItems.menu.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdminTW.userActivities.main.dailyCashregisterTransactionsBtn);
        });

        it("Filter results, verify results are loaded", () => {

            MobileAdminTW.userActivities.main.dailyCashregisterTransactionsBtn.click();
            const central = $("span=HR Central");
            const agency = $("span=MonoQA");
            const shop = $("span=vShop");
            const cashRegister = $("span=vCashR");

            central.click();
            agency.click();
            shop.scrollIntoView();
            shop.click();
            cashRegister.click();
            MobileAdminTW.common.filter.displayBtn.click();
            const transactionTypePayment = $("td*=Cash payment");
            const transactionTypePayout = $("td*=Cash payout");
            verifyIsVisible(transactionTypePayment);
            verifyIsVisible(transactionTypePayout);
        });

        it("Logout", () => {
            twLogoutIfLoggedIn();
        });
    });
});

