import { expect } from "chai";
import { env } from "../../env/environment";
import { MobileAdminGP, MobileAdminTW } from "../mobile-administration/GP";

export function searchTable(value) {
  $(".treeview__search__input").addValue(value);
}

export function verifyElementValue(element, value) {
  $(element).getValue();
  let inputValue = $(element).getValue();
  expect(inputValue).to.equal(value);
}
export function verifyElementText(element, text) {
  $(element).getHTML(false);
  let inputValue = $(element).getHTML(false);
  expect(inputValue).to.equal(text);
}

export function waitForLoader(loader = ".k-loading-image") {
  $(loader).waitForDisplayed({ reverse: true });
}

export function verifyIsNotVisible(element) {
  element.waitForDisplayed({ reverse: true });
}

export function verifyIsVisible(element) {
  element.waitForDisplayed({ reverse: false });
}

export function randomStringNum() {
  return String(Math.random()).slice(2, -1);
}

export function randomShortStringNum() {
  return Math.random().toString(36).substr(4, 6);
}

export function randomInteger() {
  return Math.floor(10000000 + Math.random() * 90000000);
}

export function mobileAdministrationSelectCompany() {
  const qa = "label=TW / HR";
  const dev = "label=ML / RootMill";

  const visibleCompanyBody = $(".modal__body").isDisplayed();
  const closeModalBtn = $(".icon--close");

  MobileAdminGP.menuItems.companySelectorMenuItem.click();
  if (!visibleCompanyBody) {
    closeModalBtn.click();
    browser.pause(1000);
    MobileAdminGP.menuItems.companySelectorMenuItem.waitForClickable();
    MobileAdminGP.menuItems.companySelectorMenuItem.click();
  } else {
    return;
  }
  browser.pause(1000);
  $(qa).click();
  //browser.pause(1000);
  $("button[title='Select']").click();
}

export function mobileAdministrationTwSelectCompany() {
  const qa = "label=TW / HR";
  const dev = "label=ML / RootMill";

  const visibleCompanyBody = $(".modal").isDisplayed();
  const homeBtn = MobileAdminTW.menuItems.homeBtn;

  MobileAdminTW.menuItems.companySelectorMenuItem.click();
  if (!visibleCompanyBody) {
    homeBtn.click();
    browser.pause(1000);
    MobileAdminTW.menuItems.companySelectorMenuItem.waitForClickable();
    MobileAdminTW.menuItems.companySelectorMenuItem.click();
  } else {
    return;
  }
  browser.pause(1000);
  $(qa).click();
  //browser.pause(1000);
  $("button[title='Select']").click();
}

export function mobileAdministrationLogout() {
  browser.url(`${env}.gp.m.admin.gp.develop/platform/`);
  MobileAdminGP.menuItems.logOutMenuItem.click();
  //verifyIsVisible(MobileAdminLoginPage.h3Title);
}

export function mobileTwAdministrationLogout() {
  browser.url(`${env}.m.admin.gp.develop/platform/`);
  MobileAdminTW.menuItems.menuBtn.click();
  MobileAdminGP.menuItems.logOutMenuItem.click();
  //verifyIsVisible(MobileAdminLoginPage.h3Title);
}

export function twLogoutIfLoggedIn() {
  const signInBtn = $("span=Sign In");
  const signInIsVisible = signInBtn.isDisplayed();
  if (!signInIsVisible) {
    mobileTwAdministrationLogout();
    browser.refresh();
  } else {
    return;
  }
}

