            MobileAdminGP.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminGP.common.filter.displayBtn.click();
            const resultheader = $(".k-grid-header");
            verifyIsVisible(resultheader);
        });

    });

    describe("CASINO OVERVIEW TESTS", () => {
        it("Open casino overview page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.cashinoOverviewBtn.waitForClickable();
        });

