            MobileAdminGP.bets.main.cashinoOverviewBtn.click();
            MobileAdminGP.common.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
        });

    });

    describe("SEARCH BY ID TESTS", () => {
        it("Open search by id page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.searchByIdBtn.waitForClickable();
        });

        it("Search for a bet slip, verify page is loaded", () => {
            MobileAdminGP.bets.main.searchByIdBtn.click();
            MobileAdminGP.bets.searchByID.betSlipNumberInput.addValue('3-47275');
            MobileAdminGP.bets.searchByID.searchBtn.doubleClick();
            const betslipHeaderInfo = $(".table__head").$("span*=3-47275");
            verifyIsVisible(betslipHeaderInfo);
        });

        it("Click the header back button, verify page is loaded", () => {
            const headerBackBtn = $(".icon--nav-back--white");
            headerBackBtn.click();
            verifyIsVisible(MobileAdminGP.bets.searchByID.betSlipNumberInput);
        });


    });

    describe("SEARCH TESTS", () => {
        it("Open search page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.searchBtn.waitForClickable();
        });

        it("Open search bets page, verify page is loaded", () => {
            MobileAdminGP.bets.main.searchBtn.click();
            verifyIsVisible(MobileAdminGP.common.filter.selectShopMenu.selectAllBtn);
            MobileAdminGP.common.filter.selectShopMenu.selectAllBtn.click();
        });

    });

    describe("BET SLIPS FOR PAYOUT TESTS", () => {

        it("Open bets slips for payout page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.betSlipsForPayoutBtn.waitForClickable();
        });

        it("Filter bet slips, verify items are loaded", () => {
            MobileAdminGP.bets.main.betSlipsForPayoutBtn.click();
            MobileAdminGP.common.filter.selectShopMenu.selectAllBtn.click();

            $("button[title='Display']").click();
        });

        it("Open a result, verify page is loaded", () => {
            $("tr:nth-of-type(1) > .c-poiner.type--link").click();
            const forPayoutTitle = $(".table__head__data.type--left").$("span*=For Payout ");
            verifyIsVisible(forPayoutTitle);
        });
    });

    describe("CRITICAL BET SLIPS TESTS", () => {
        it("Open critical bets slips page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.criticalBetSlipsBtn.waitForClickable();

        });

        it("Filter results, verify results are displayed", () => {
            const firstCentralChekbox = $(".rc-tree-list-holder-inner .rc-tree-treenode-switcher-close:nth-of-type(1) .rc-tree-checkbox");
            const secondCentralCheckbox = $(".rc-tree-treenode.rc-tree-treenode-leaf-last.rc-tree-treenode-switcher-close > .rc-tree-checkbox");

            MobileAdminGP.bets.main.criticalBetSlipsBtn.click();
            verifyIsVisible(MobileAdminGP.common.filter.selectShopMenu.clearBtn)
            firstCentralChekbox.click();
            secondCentralCheckbox.click();
            $("button[title='Display']").click();
            const header = $("table > .k-grid-header")
            verifyIsVisible(header);
        });

        it("Open a result verify page is loaded", () => {
            const firstResultElement = $("tr:nth-of-type(1) > .c-poiner.type--link");
            firstResultElement.click();
            verifyIsVisible($(".dropdown--multi"));
        });
    });

    describe("TURNOVER REPORT TESTS", () => {
        it("Open turnover report page, verify page is loaded", () => {

            MobileAdminGP.menuItems.betsMenuItem.click();
            MobileAdminGP.bets.main.turnoverReportBtn.waitForClickable();
        });

        it("Open tournover report page, verify page is loaded", () => {
            MobileAdminGP.bets.main.turnoverReportBtn.click();
            verifyIsVisible(MobileAdminGP.common.filter.selectShopMenu.selectAllBtn);
        });

        it("Filter results, verify page is loaded", () => {
            MobileAdminGP.common.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
            const tableHeader = $(".k-grid-header .k-header:nth-of-type(1) .k-link");
            verifyIsVisible(tableHeader);
        });
    });

});

