import { mobileAdministration } from "../../../../env/environment";
import { mobileAdministrationSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminGP } from "../../../../pageobjects/mobile-administration/GP";

describe("MOBILE ADMIN - AGENCY", () => {

    describe("NEW AGENCY TESTS", () => {

        it("Open agency page, verify page does not crash", () => {
            mobileAdministration();
            MobileAdminGP.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationSelectCompany();
            MobileAdminGP.menuItems.agencyMenuItem.click();
        });

        it("Open new agency page, verify page does not crash", () => {
            MobileAdminGP.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            verifyIsVisible(centralName);
        });

        it("Select Central, verify page is opened", () => {
            MobileAdminGP.menuItems.agencyMenuItem.click();
            MobileAdminGP.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            centralName.waitForClickable();
            centralName.click();
            const agencyname = $("div=MonoQA");
            verifyIsVisible(agencyname);
            verifyIsVisible(MobileAdminGP.agency.newAgency.addNewAgencyBtn);

        });

        it("Open Agency create page", () => {
            MobileAdminGP.agency.newAgency.addNewAgencyBtn.waitForClickable();
            MobileAdminGP.agency.newAgency.addNewAgencyBtn.click();
        });

        it("Create an agency, verify", () => {
            const randomAgencyNum = randomStringNum();
            MobileAdminGP.agency.newAgency.agencyNameInput.addValue(`Automated${randomAgencyNum}`);
            MobileAdminGP.agency.newAgency.agencyAddressInput.addValue('address');
            MobileAdminGP.agency.agencyManagement.selectCurrency("li=Euro (EUR)");
            /* $("[type='submit']").click();
            verifyIsVisible($("div=Agency created successfully")); */  //Remove comment if you want to create agencies
        });
    });

    describe("NEW AGENT PARTNER TESTS", () => {

        it("Open new agent partner page", () => {

            MobileAdminGP.menuItems.agencyMenuItem.click();
            MobileAdminGP.agency.main.newAgentPartnerBtn.click();
        });

        it("Create agent partner", () => {
            MobileAdminGP.agency.newAgentPartner.usernameInput.addValue(`autoAgentPartner${randomStringNum()}`);
            MobileAdminGP.agency.newAgentPartner.passwordInput.addValue('mono.123');
            MobileAdminGP.agency.newAgentPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdminGP.agency.newAgentPartner.firstNameInput.addValue(randomStringNum());
            MobileAdminGP.agency.newAgentPartner.lastNameInput.addValue(randomStringNum());
            const central = $('span=HR Central');
            central.click();
            const agency = $('span=MonoQA');
            agency.click();
            $("[type='submit'] .btn__label").click();
            const successToastMessage = $("div=Agency Partner created successfully");
            verifyIsVisible(successToastMessage);
            browser.pause(1000);
        });
    });

    describe("EDIT PARTNER TESTS", () => {
        it("Open Edit partner page, verify page is opened", () => {


            MobileAdminGP.menuItems.agencyMenuItem.click();
            MobileAdminGP.agency.main.editPartnerBtn.click();
            verifyIsVisible(MobileAdminGP.agency.editPartner.userInput);
            verifyIsVisible(MobileAdminGP.agency.editPartner.filterLabel);
            verifyIsVisible(MobileAdminGP.agency.editPartner.roleDropdown);
        });

        const backButton = ".icon--nav-back--white";
        const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";

        it("Verify Agent roles are filtered", () => {
            MobileAdminGP.menuItems.agencyMenuItem.click();
            MobileAdminGP.agency.main.editPartnerBtn.click();
            MobileAdminGP.agency.editPartner.selectRole('Agent');
            MobileAdminGP.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Agent");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Shop Manager roles are filtered", () => {
            MobileAdminGP.menuItems.agencyMenuItem.click();
            MobileAdminGP.agency.main.editPartnerBtn.click();
            MobileAdminGP.agency.editPartner.selectRole('Shop manager');
