import { mobileTwAdministration } from "../../../../env/environment";
import { mobileAdministrationTwSelectCompany, randomStringNum, twLogoutIfLoggedIn, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminTW } from "../../../../pageobjects/mobile-administration/GP";

describe("MOBILE ADMIN - AGENCY", () => {

    describe("NEW AGENCY TESTS", () => {

        it("Open agency page, verify page does not crash", () => {
            mobileTwAdministration();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.agencyMenuItem.click();
        });

        it("Open new agency page, verify page does not crash", () => {
            MobileAdminTW.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            verifyIsVisible(centralName);
        });

        it("Select Central, verify page is opened", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            centralName.waitForClickable();
            centralName.click();
            const agencyname = $("div=MonoQA");
            verifyIsVisible(agencyname);
            verifyIsVisible(MobileAdminTW.agency.newAgency.addNewAgencyBtn);

        });

        it("Open Agency create page", () => {
            MobileAdminTW.agency.newAgency.addNewAgencyBtn.waitForClickable();
            MobileAdminTW.agency.newAgency.addNewAgencyBtn.click();
        });

        it("Create an agency, verify", () => {
            const randomAgencyNum = randomStringNum();
            MobileAdminTW.agency.newAgency.agencyNameInput.addValue(`Automated${randomAgencyNum}`);
            MobileAdminTW.agency.newAgency.agencyAddressInput.addValue('address');
            MobileAdminTW.agency.agencyManagement.selectCurrency("li=Euro (EUR)");
            /* $("[type='submit']").click();
            verifyIsVisible($("div=Agency created successfully")); */  //Remove comment if you want to create agencies
        });
    });

    describe("NEW AGENT PARTNER TESTS", () => {

        it("Open new agent partner page", () => {

            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.newAgentPartnerBtn.click();
        });

        it("Create agent partner", () => {
            MobileAdminTW.agency.newAgentPartner.usernameInput.addValue(`autoAgentPartner${randomStringNum()}`);
            MobileAdminTW.agency.newAgentPartner.passwordInput.addValue('mono.123');
            MobileAdminTW.agency.newAgentPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdminTW.agency.newAgentPartner.firstNameInput.addValue(randomStringNum());
            MobileAdminTW.agency.newAgentPartner.lastNameInput.addValue(randomStringNum());
            const central = $('span=HR Central');
            central.click();
            const agency = $('span=MonoQA');
            agency.click();
            $("[type='submit'] .btn__label").click();
            const successToastMessage = $("div=Agency Partner created successfully");
            verifyIsVisible(successToastMessage);
            browser.pause(1000);
        });
    });

    describe("EDIT PARTNER TESTS", () => {
        it("Open agency page, verify page does not crash", () => {

            mobileTwAdministration();
            MobileAdminTW.common.twLogoutIfLoggedIn();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.agencyMenuItem.click();
        });

        it("Open Edit partner page, verify page is opened", () => {


            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            verifyIsVisible(MobileAdminTW.agency.editPartner.userInput);
            verifyIsVisible(MobileAdminTW.agency.editPartner.filterLabel);
            verifyIsVisible(MobileAdminTW.agency.editPartner.roleDropdown);
        });

        const backButton = ".icon--arrow-left";
        const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";

        it("Verify Agent roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Agent');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Agent");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Shop Manager roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Shop manager');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Betting Shop Manager");
            verifyIsVisible(roleElement);
            $(backButton).click();
