            MobileAdminTW.agency.editPartner.selectRole('Partner');
            MobileAdminTW.common.search();
            $(firstFilteredResult).click();
            MobileAdminTW.agency.editPartner.resetPasswordGenerateBtn.click();
            MobileAdminTW.agency.editPartner.copyNewPasswordBtn.waitForClickable();
            MobileAdminTW.agency.editPartner.copyNewPasswordBtn.click();
