import { mobileWebTwDeV2 } from "../../../env/environment";
import { verifyIsVisible } from "../../../pageobjects/common/Common.page";
import { default as MobileWebV2 } from "../../../pageobjects/mobile-web/MobileWebV2";

describe("Mobile Web TWDE Tests", () => {
    const username = "ba002";
    const password = "Mono.123";

    it("Verify that the TWDE mobile Home page is opened and go to login page", () => {
        mobileWebTwDeV2();
        browser.setWindowSize(375, 812);
        verifyIsVisible(MobileWebV2.mobileHomePage.companyLogo);
        verifyIsVisible(MobileWebV2.mobileBottomNavbar.menuBtn);
        MobileWebV2.mobileBottomNavbar.menuBtn.click();
        verifyIsVisible(MobileWebV2.mobileMenuSidebar.loginBtn);
        MobileWebV2.mobileMenuSidebar.loginBtn.click();
    });

    it("Verify that the TWDE mobile web login page is opened", () => {
        // browser.url('http://qa.de.m.web.gp.develop/en/Membership/Authentication/Login');
        verifyIsVisible(MobileWebV2.mobileHomePage.companyLogo);
        verifyIsVisible(MobileWebV2.mobileMenuSidebar.loginBtn);
        verifyIsVisible(MobileWebV2.mobileLoginPage.welcomeLabel);
    });
    it('Verify login page elements are visible', () => {
        MobileWebV2.mobileLoginPage.loginSubmitBtn.click();
        verifyIsVisible(MobileWebV2.mobileLoginPage.loginSubmitBtn);
        verifyIsVisible(MobileWebV2.mobileLoginPage.passwordInput);
        verifyIsVisible(MobileWebV2.mobileLoginPage.passwordLabel);
        verifyIsVisible(MobileWebV2.mobileLoginPage.usernameInput);
        verifyIsVisible(MobileWebV2.mobileLoginPage.usernameLabel);
        verifyIsVisible(MobileWebV2.mobileLoginPage.forgotPasswordBtn);
        verifyIsVisible(MobileWebV2.mobileLoginPage.forgotUserameBtn);
    });
    it("Verify required messages", () => {
        MobileWebV2.mobileLoginPage.loginSubmitBtn.click();
        verifyIsVisible(MobileWebV2.mobileLoginPage.passwordRequiredValidationMessage);
        verifyIsVisible(MobileWebV2.mobileLoginPage.usernameRequiredValidationMessage);
    });

    it("Add invalid password, verify error message", () => {
        browser.url('http://qa.de.m.web.gp.develop/en/Membership/Authentication/Login');
        MobileWebV2.mobileLoginPage.usernameInput.waitForClickable();
        MobileWebV2.mobileLoginPage.usernameInput.addValue(username);
        MobileWebV2.mobileLoginPage.passwordInput.addValue("aieugb324.");
        MobileWebV2.mobileLoginPage.loginSubmitBtn.click();
        verifyIsVisible(MobileWebV2.mobileLoginPage.invalidUsernameOrPasswordMessage);
    });

   /*  it("Verify if betting activity is displayed", () => {
        browser.url('http://qa.de.m.web.gp.develop/en/betting-activity');
        verifyIsVisible(MobileWebV2.bettingActivityReview.bettingActivityLabel);
        MobileWebV2.bettingActivityReview.betActContinueBtn.click();
    }); */


    it("Log in, verify it is a success", () => {
        browser.url('http://qa.de.m.web.gp.develop/en/Membership/Authentication/Login');
        MobileWebV2.mobileLoginPage.usernameInput.waitForClickable();
        MobileWebV2.mobileLoginPage.usernameInput.addValue(username);
        MobileWebV2.mobileLoginPage.passwordInput.addValue(password);
        MobileWebV2.mobileLoginPage.loginSubmitBtn.click();
        MobileWebV2.bettingActivityReview.betActContinueBtn.click();
        MobileWebV2.mobileBottomNavbar.menuBtn.click();
       
        verifyIsVisible(MobileWebV2.mobileMenuSidebar.sidebar);
       
        const checkUsername = $("span*=ba002");
        verifyIsVisible(checkUsername);

    });

    it("Logout, verify user is logged out", () => {
        browser.url('http://qa.de.m.web.gp.develop/en/Membership/Authentication/Login');
        MobileWebV2.mobileBottomNavbar.menuBtn.waitForClickable();
        MobileWebV2.mobileBottomNavbar.menuBtn.click();
        verifyIsVisible(MobileWebV2.mobileMenuSidebar.sidebar);
        //  waitForDisplayed(MobileWebV2.mobileLoginPage.logoutBtn);
        MobileWebV2.mobileMenuSidebar.logoutBtn.click();

      
    });


});

