import { webTwDeV2 } from "../../../../env/environment";
import { verifyElementValue, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { BetSlip, Header, LoginPage } from "../../../../pageobjects/web/web-v2";
import { confirmCookies, verifyBettingActivity } from "../../../../pageobjects/web/web-v2/Common";

describe("Submit Slip", () => {


    const username = "at-007";
    const password = "Mono.123"

    it("Login to Web", () => {
        webTwDeV2();
        browser.setWindowSize(1400, 1200);
        verifyIsVisible(Header.headerLogo);
        confirmCookies();
        Header.loginBtn.click();
        LoginPage.usernameInput.waitForClickable();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue(password);
        LoginPage.loginBtn.click();

        verifyBettingActivity();
    });

    it("Submit bet slip", () => {
        browser.url("http://qa.de.web.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");
        const quota = $('button=11.00');
        quota.click();
        BetSlip.submitBetButton.doubleClick();
        const submittedToastMessage = $('div=Bet slip submitted');

        verifyIsVisible(submittedToastMessage);
    });

    it("Update stake, verify stake is updated", () => {
        BetSlip.totalStakeInput.doubleClick();
        BetSlip.totalStakeInput.addValue("100.00");
        BetSlip.totalStakeLabel.click();
        verifyElementValue(BetSlip.totalStakeInput, "100.00");
    });

    it("Submit slip with new values, verify its a success", () => {
        const submittedToastMessage = $('div=Bet slip submitted');
        BetSlip.submitBetButton.doubleClick();
        verifyIsVisible(submittedToastMessage);
    });

    it("Verify my bets data", () => {
        const eventName = $(".widget--mybets__list").$("div*=Davor Longbeards");
        const paymentAmount = $(".widget--mybets__list").$("div*=100.00");
        const maxGain = $(".widget--mybets__list").$("div*=1100.00");
        const maxCoef = $(".widget--mybets__list").$("div*=11.00");
        verifyIsVisible(eventName);
        verifyIsVisible(paymentAmount);
        verifyIsVisible(maxGain);
        verifyIsVisible(maxCoef);
    });
});

