import { verifyElementText, verifyElementValue, verifyIsVisible } from "../../../pageobjects/common/Common.page";
import { default as MobileWebV2 } from "../../../pageobjects/mobile-web/MobileWebV2";
import { BetSlip, Header, LoginPage } from "../../../pageobjects/web/web-v2";
import { confirmCookies, verifyBettingActivity } from "../../../pageobjects/web/web-v2/Common";

const username = "at-007";
const password = "Mono.123";
describe("Mobile TW de", () => {

    it("Login to mobile web", () => {


        mobileWebTwDeV2();
        browser.setWindowSize(375, 812);
        MobileWebV2.cookieConsent.closeCookieConsentButton();



        verifyIsVisible(MobileWebV2.mobileHomePage.companyLogo);
        verifyIsVisible(MobileWebV2.mobileBottomNavbar.menuBtn);
        MobileWebV2.mobileBottomNavbar.menuBtn.click();
        verifyIsVisible(MobileWebV2.mobileMenuSidebar.loginBtn);
        MobileWebV2.mobileMenuSidebar.loginBtn.click();
        MobileWebV2.mobileLoginPage.usernameInput.waitForClickable();
        MobileWebV2.mobileLoginPage.usernameInput.addValue(username);
        MobileWebV2.mobileLoginPage.passwordInput.addValue(password);
        MobileWebV2.mobileLoginPage.loginSubmitBtn.click();
        MobileWebV2.bettingActivityReview.acceptBettingActivityReview();
        MobileWebV2.mobileBottomNavbar.menuBtn.click();
    });

    it("Add quotas to bet slip, submit slip", () => {
        browser.url("http://qa.de.m.web.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");
        const quota = $("button[title='1 - 11.00']");
        quota.waitForClickable();
        quota.click();
        MobileWebV2.betSlipMenu.submitBetButton.click();
        MobileWebV2.betSlipMenu.submitModalYesButton.waitForClickable();
        MobileWebV2.betSlipMenu.submitModalYesButton.click();
        const successfulSSubmittedSlipMessage = $("div=Bet slip submitted");
        verifyIsVisible(successfulSSubmittedSlipMessage);
    });

    it("Update total stake, verify stake and payment are a match", () => {
        MobileWebV2.betSlipMenu.showSlipButton.waitForClickable();
        MobileWebV2.betSlipMenu.showSlipButton.click();
        MobileWebV2.betSlipPage.totalStakeInput.click();
        MobileWebV2.numpad.numpadButton1.click();
        MobileWebV2.numpad.numpadButton0.click();
        MobileWebV2.numpad.numpadButton0.click();

        MobileWebV2.numpad.numpadDoneButton.waitForClickable();
        MobileWebV2.numpad.numpadDoneButton.click();

        const paymentValue = $("[name='totalStake']");
        verifyElementValue(paymentValue, "100.00");
    });


});

describe("Web TW de tests", () => {

    it("Login to Web", () => {
        webTwDeV2();
        browser.setWindowSize(1400, 1200);
        browser.wi
        verifyIsVisible(Header.headerLogo);
        confirmCookies();
        Header.loginBtn.click();
        LoginPage.usernameInput.waitForClickable();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue(password);
        LoginPage.loginBtn.click();
        verifyBettingActivity();
    });

    it("Submit bet slip", () => {
        browser.url("http://qa.de.web.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");
        const quota = $('button=11.00');
        quota.click();
        BetSlip.submitBetButton.doubleClick();
        const submittedToastMessage = $('div=Bet slip submitted');

        verifyIsVisible(submittedToastMessage);
    });

    it("Update stake, verify stake is updated", () => {
        BetSlip.totalStakeInput.doubleClick();
        BetSlip.totalStakeInput.addValue("100.00");
        BetSlip.totalStakeLabel.click();
        verifyElementValue(BetSlip.totalStakeInput, "100.00");
    });

    it("Submit slip with new values, verify its a success", () => {
        const submittedToastMessage = $('div=Bet slip submitted');
        BetSlip.submitBetButton.doubleClick();
        verifyIsVisible(submittedToastMessage);
    });

    it("Verify my bets data", () => {
        const eventName = $(".widget--mybets__list").$("div*=Davor Longbeards");
        const paymentAmount = $(".widget--mybets__list").$("div*=100.00");
