import { webTwDeV2 } from "../../../../env/environment";
import { verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { LoginPage } from "../../../../pageobjects/web/web-v2";
import { closeDepositLimitModal, confirmCookies, verifyBettingActivity } from "../../../../pageobjects/web/web-v2/Common";
import Header from "../../../../pageobjects/web/web-v2/Header";

describe("WEB TWDE LOGIN TESTS", () => {
    const username = 'terminator01';
    const password = 'Mono.123';

    it("Open TW DE web, verify page is opened", () => {
        webTwDeV2();
        browser.setWindowSize(1400, 1200);
        verifyIsVisible(Header.headerLogo);
        confirmCookies();

    });

    it('Verify login page elements are visible', () => {
        Header.loginBtn.click();
        verifyIsVisible(LoginPage.loginBtn);
        verifyIsVisible(LoginPage.loginImage);
        verifyIsVisible(LoginPage.passwordInput);
        verifyIsVisible(LoginPage.passwordLabel);
        verifyIsVisible(LoginPage.usernameInput);
        verifyIsVisible(LoginPage.usernameLabel);
        verifyIsVisible(LoginPage.logInTitle);
        verifyIsVisible(LoginPage.forgotPasswordBtn);
        verifyIsVisible(LoginPage.forgotUserameBtn);
    });

    it("Verify required messages", () => {
        LoginPage.loginBtn.click();
        verifyIsVisible(LoginPage.passwordRequiredValidationMessage);
        verifyIsVisible(LoginPage.usernameRequiredValidationMessage);
    });

    it("Add invalid password, verify error message", () => {
        browser.url('http://qa.de.web.gp.develop/en/Membership/Authentication/Login');
        LoginPage.usernameInput.waitForClickable();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue("aieugb324.");
        LoginPage.loginBtn.click();
        verifyIsVisible(LoginPage.invalidUsernameOrPasswordMessage);
    });

    it("Log in, verify it is a success", () => {
        webTwDeV2();
        Header.loginBtn.click();
        LoginPage.usernameInput.waitForClickable();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue(password);
        LoginPage.loginBtn.click();
        closeDepositLimitModal();
        verifyBettingActivity();
    });

    it("Verify user display elements are visible", () => {
        Header.profilePic.click();
        verifyIsVisible(Header.userDisplay.accountSettingsBtn);
        verifyIsVisible(Header.userDisplay.accountStatementBtn);
        verifyIsVisible(Header.userDisplay.logoutBtn);
        verifyIsVisible(Header.userDisplay.myBetsBtn);
        verifyIsVisible(Header.userDisplay.offlineWalletLabel);
        verifyIsVisible(Header.userDisplay.onlineWalletLabel);
        verifyIsVisible(Header.userDisplay.logoutBtn);
    });

    it("Logout, verify user is logged out", () => {
        webTwDeV2();
        Header.profilePic.click();
        Header.userDisplay.logoutBtn.click();
        verifyIsVisible(Header.loginBtn)
    });


});

