import { administration, webTwDeV2 } from "../../../../env/environment";
import { loginPage } from "../../../../pageobjects/administration.page";
import { randomInteger, verifyElementValue, verifyIsNotVisible, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { Header, LoginPage, PersonalDataPage } from "../../../../pageobjects/web/web-v2";
import { acceptTermsAndConditions, closeDepositLimitModal, confirmCookies, verifyBettingActivity } from "../../../../pageobjects/web/web-v2/Common";

describe("Web TW DE Personal data tests", () => {

    const username = 'at-001';
    const password = "Mono.1234";

    it("Login to web, verify page is opened", () => {

        webTwDeV2();
        browser.setWindowSize(1400, 1200);
        confirmCookies();
        browser.url('http://qa.de.web.gp.develop/en/Membership/Authentication/Login');
        LoginPage.usernameInput.waitForClickable();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue(password);
        LoginPage.loginBtn.click();
        acceptTermsAndConditions();
        closeDepositLimitModal();
        verifyBettingActivity();
        Header.profilePic.click();
        const userLockButton = $("span=Create a 24 h lock?")
        verifyIsVisible(userLockButton);
    });

    it("Verify Personal data page", () => {
        Header.userDisplay.accountSettingsBtn.click();
        verifyIsVisible(PersonalDataPage.personalDataTitle)
        verifyIsVisible(PersonalDataPage.usernameInput);
        verifyIsVisible(PersonalDataPage.firstnameInput);
        verifyIsVisible(PersonalDataPage.lastnameInput);
        verifyIsVisible(PersonalDataPage.dobInput);
        verifyIsVisible(PersonalDataPage.countryInput);
        verifyIsVisible(PersonalDataPage.cityInput);
        verifyIsVisible(PersonalDataPage.streetInput);
        verifyIsVisible(PersonalDataPage.zipcodeInput);
        verifyIsVisible(PersonalDataPage.houseNumberInput);
        verifyIsVisible(PersonalDataPage.emailInput);
        verifyIsVisible(PersonalDataPage.mobilePhoneNumberInput);
        verifyIsVisible(PersonalDataPage.contactLanguageSelector);
        verifyIsVisible(PersonalDataPage.newsLetterCheckbox);
    });

    it("Change phone number, enter invalid password, verify error message", () => {

        browser.url("http://qa.de.web.gp.develop/en/Administration/AccountSettings/PersonalData");
        PersonalDataPage.mobilePhoneNumberInput.clearValue();
        PersonalDataPage.mobilePhoneNumberInput.addValue(`+${randomInteger()}`);
        PersonalDataPage.nextBtn.click();
        PersonalDataPage.passwordCheckInput.addValue("aoegfah213.");
        PersonalDataPage.passwordCheckSaveBtn.click();
        const incorrectPasswordMessage = $("div=Entered password is incorrect. Please try again");
        verifyIsVisible(incorrectPasswordMessage);

    });

    it("Cancel the password confirmation, verify error message is not visible", () => {
        const incorrectPasswordMessage = $("div*=Entered password is incorrect. Please try again");
        PersonalDataPage.passwordCheckCancelBtn.click();
        PersonalDataPage.nextBtn.click();
        verifyIsNotVisible(incorrectPasswordMessage);
    });

    let randomPhoneNumber = `+${randomInteger()}`;

    it("Change phone number, verify phone number title is updated", () => {
        Header.profilePic.click();
        Header.userDisplay.accountSettingsBtn.click();
        PersonalDataPage.mobilePhoneNumberInput.clearValue();
        PersonalDataPage.mobilePhoneNumberInput.addValue(randomPhoneNumber);
        PersonalDataPage.nextBtn.click();
        let changedPhoneNumberText = $(`div*=${randomPhoneNumber}`);
        verifyIsVisible(changedPhoneNumberText);
        PersonalDataPage.passwordCheckInput.addValue(password);
        PersonalDataPage.passwordCheckSaveBtn.click();
    });

    it("Verify the mobile phone number is changed successfully", () => {
        const successfullMessage = $("div=Personal data updated successfully");
        verifyIsVisible(successfullMessage);
        const mobilePhoneNumberInput = $("[type='tel']");
        verifyElementValue(mobilePhoneNumberInput, randomPhoneNumber);
    });






});

