import { mobileAdministration, mobileTwAdministration, webTwDeV2 } from "../../../env/environment";
import { randomShortStringNum, verifyElementValue, verifyIsVisible } from "../../../pageobjects/common/Common.page";
import { MobileAdminTW } from "../../../pageobjects/mobile-administration/GP";
import { MenuItemsPage } from "../../../pageobjects/web/web-v1";
import { Header, LoginPage } from "../../../pageobjects/web/web-v2";



describe("Cashier tests", () => {

    describe("Card activation tests", () => {

        it("Verify login was successfull, Cashier role", () => {
            mobileTwAdministration();
            MobileAdminTW.login.usernameInput.addValue("vcashiertwde");
            MobileAdminTW.login.passwordInput.addValue("mono.123");
            MobileAdminTW.login.signInBtn.click();

        });

        it("Open the new player page", () => {
            MobileAdminTW.menuItems.cashRegisterItem.click();
            MobileAdminTW.cashRegister.newPlayerBtn.click();
            MobileAdminTW.cashRegister.newPlayer.createBtn.click();
            MobileAdminTW.cashRegister.newPlayer.username.doubleClick();

            const randomPlayer = `at-${randomShortStringNum()}`;
            const password = 'password.123';

            MobileAdminTW.cashRegister.newPlayer.username.addValue(randomPlayer);
            MobileAdminTW.cashRegister.newPlayer.password.doubleClick();
            MobileAdminTW.cashRegister.newPlayer.password.addValue(password);
            MobileAdminTW.cashRegister.newPlayer.createAccountBtn.click();

            const successMessage = $("div=User created successfully");
            verifyIsVisible(successMessage);

            webTwDeV2();
            Header.loginBtn.click();
            LoginPage.usernameInput.addValue(randomPlayer);
            LoginPage.passwordInput.addValue(password);
            LoginPage.loginBtn.click();
            browser.pause(5000);
        });

    });

    describe("cashier settlement tests", () => {
        it("Open cashier settlement page, verify page is opened", () => {
            MobileAdminTW.common.twLogoutIfLoggedIn();
            mobileTwAdministration();
            MobileAdminTW.login.usernameInput.addValue("vcashiertwde");
            MobileAdminTW.login.passwordInput.addValue("mono.123");
            MobileAdminTW.login.signInBtn.click();
            MobileAdminTW.menuItems.cashRegisterItem.click();
            MobileAdminTW.cashRegister.cashierSettlementBtn.click();
            MobileAdminTW.cashRegister.casherSettlement.settleUpButton.click();
            browser.pause(2000);
            verifyElementValue(MobileAdminTW.cashRegister.casherSettlement.exitAmountInput, "0.00");
        });
    });



});

